import React from 'react';

function DefineAxes() {
    return (
        <div className="define-axes">
            <h2>Define Axes</h2>
            <div className="left">
                <h3>X-axis</h3>
            </div>
            <label>x-axis name</label>
            <input type="txt"></input>
            <label>y-axis name</label>
            <input type="txt"></input>
        </div>
    )
}

export default DefineAxes
